import {Link} from 'react-router-dom';
const AvocadoHeader =({logged, setLogged})=>{

    return (
        <header>
            <h1>Avocation.com</h1>
            <p>your bright side hobbies</p>
            <div class='user'>
            logged? <Link to="" />:<Link />;
            </div>
        </header>
    );
}

export default AvocadoHeader;
